import React, { useState, useEffect, useRef } from 'react';
import './navbar.css';
import playbttn from './icon/play-button.png';
import io from './icon/control-center.png';
import siri from './icon/siri.png';
import Dock from './Dock';
import Clock from './Clock';

export default function Navbar() {
  const [dropdownApple, setDropdownApple] = useState(false);
  const [dropdownFinder, setDropdownFinder] = useState(false);
  const [dropdownFile, setDropdownFile] = useState(false);
  const [dropdownEdit, setDropdownEdit] = useState(false);
  const [dropdownView, setDropdownView] = useState(false);
  const [dropdownGo, setDropdownGo] = useState(false);
  const [dropdownWindow, setDropdownWindow] = useState(false);
  const [dropdownHelp, setDropdownHelp] = useState(false);

  const dropdownRefs = useRef([]);

  const toggleDropdown = (index) => {
    const dropdownStates = [
      setDropdownApple,
      setDropdownFinder,
      setDropdownFile,
      setDropdownEdit,
      setDropdownView,
      setDropdownGo,
      setDropdownWindow,
      setDropdownHelp,
    ];

    dropdownStates.forEach((setState, i) => {
      if (i === index) {
        setState((prevState) => !prevState);
      } else {
        setState(false);
      }
    });
  };

  const closeDropdowns = () => {
    dropdownRefs.current.forEach((dropdownRef) => {
      dropdownRef.style.display = 'none';
    });
  };

  useEffect(() => {
    const handleClickOutside = (event) => {
      const isClickInsideDropdown = dropdownRefs.current.some((dropdownRef) =>
        dropdownRef.contains(event.target)
      );

      if (!isClickInsideDropdown) {
        closeDropdowns();
      }
    };

    document.addEventListener('click', handleClickOutside);
    return () => {
      document.removeEventListener('click', handleClickOutside);
    };
  }, []);

  return (
    <>
      <link
        rel="stylesheet"
        href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css"
      ></link>
      <body>
        <div className="nav">
          <div className="left">
            <a onClick={() => toggleDropdown(0)}>
              <i className="fa fa-apple"></i>
            </a>
            <a onClick={() => toggleDropdown(1)}>
              <strong>Finder</strong>
            </a>
            <a onClick={() => toggleDropdown(2)}>File</a>
            <a onClick={() => toggleDropdown(3)}>Edit</a>
            <a onClick={() => toggleDropdown(4)}>View</a>
            <a onClick={() => toggleDropdown(5)}>Go</a>
            <a onClick={() => toggleDropdown(6)}>Window</a>
            <a onClick={() => toggleDropdown(7)}>Help</a>
          </div>
          <div className="right">
            <a>
              <img className="playbttn" src={playbttn} alt="" />
            </a>
            <a className="wifi">
              <i className="fa fa-wifi"></i>
            </a>
            <a>
              <i className="fa fa-search"></i>
            </a>
            <a>
              <img className="io" src={io} alt="" />
            </a>
            <a>
              <img className="siri" src={siri} alt="" />
            </a>
            <a>
              <strong>
                <Clock />
              </strong>
            </a>
          </div>
        </div>
        {dropdownApple && (
          <div className="dropdown-content-Apple" ref={(ref) => (dropdownRefs.current[0] = ref)}>
            <a className='ATM'>About This Mac</a>
              <a>System Settings</a>
              <a className='ATM'>App Store</a>
              <a className='ATM' >Recent Items</a>
              <a className='ATM'>Force Quit...</a>
              <a>Sleep</a>
              <a>Restart...</a>
              <a className='ATM'>Shut Down...</a>
              <a>Lock Screen</a>
              <a className='ATM'>Log Out User...</a>
          </div>
        )}
        {dropdownFinder && (
          <div className="dropdown-content-Finder" ref={(ref) => (dropdownRefs.current[1] = ref)}>
            <a className="ATM">About Finder</a>
            <a className='ATM'>Settings...</a>
            <a className='ATM'>Empty Bin...</a>
            <a className='ATM'>Services</a>
            <a>Hide Finder</a>
            <a>Hide Others</a>
            <a className="show">Show All</a>
          </div>
        )}
        {dropdownFile && (
          <div className="dropdown-content-File" ref={(ref) => (dropdownRefs.current[2] = ref)}>
            <a>New Finder Window</a>
            <a>New Folder</a>
              <a className="show">New Folder with Selection</a>
              <a>New Smart Folder</a>
              <a>New Tab</a>
              <a className="show">Open</a>
              <a className="show">Open With</a>
              <a className='ATM'>Close Window</a>
              <a>Get Info</a>
              <a className="show">Rename</a>
              <a className="show">Compress</a>
              <a className="show">Duplicate</a>
              <a className="show">Make Alias</a>
              <a className="show">Quick Look</a>
              <a href="" className="showatm">Print</a>
              <a href="" className="showatm">Sahre...</a>
              <a href="" className="show">Show Original</a>
              <a href="" className="showatm">Add to Sidebar</a>
              <a href="" className="show">Move to Bin</a>
              <a href="" className="showatm">Eject</a>
              <div className="color">
                <a className='red'><i class='fa fa-circle'></i></a>
                <a className='orange'><i class='fa fa-circle'></i></a>
                <a className='yellow'><i class='fa fa-circle'></i></a>
                <a className='green'><i class='fa fa-circle'></i></a>
                <a className='blue'><i class='fa fa-circle'></i></a>
                <a className='purple'><i class='fa fa-circle'></i></a>
                <a className='grey'><i class='fa fa-circle'></i></a>
              </div>
              <a href="" className="showatm">Tags...</a>
              <a>Find</a>
          </div>
        )}
        {dropdownEdit && (
          <div className="DropEdit" ref={(ref) => (dropdownRefs.current[3] = ref)}>
            <a className="show">Undo</a>
            <a  className="showatm">Redo</a>
             <a  className="show">Cut</a>
             <a  className="show">Copy</a>
             <a  className="show">Paste</a>
             <a  className="showatm">Select All</a>
             <a  className="ATM">Show Clipboard</a>
             <a>Start Dictation</a>
             <a>Emoji & Symbols</a>
          </div>
        )}
        {dropdownView && (
          <div className="DropView" ref={(ref) => (dropdownRefs.current[4] = ref)}>
            <a className="show">as Icons</a>
            <a className="show">as Lists</a>
             <a className="show">as Columns</a>
             <a className="showatm">as Gallery</a>
             <a><i className='fa fa-check'> Use Stacks</i></a>
          </div>
        )}

        <Dock />
      </body>
    </>
  );
}
